BEGIN TRANSACTION;
DROP TABLE IF EXISTS "users";
CREATE TABLE IF NOT EXISTS "users" (
	"_id"	text,
	"active"	boolean,
	"createdDate"	bigint,
	"lastLogin"	bigint,
	"role"	text,
	"signUpSource"	text,
	"state"	text
);
DROP TABLE IF EXISTS "brands";
CREATE TABLE IF NOT EXISTS "brands" (
	"_id"	text,
	"barcode"	text,
	"category"	text,
	"categoryCode"	text,
	"cpg_id"	text,
	"cpg_ref"	text,
	"name"	text,
	"topBrand"	boolean,
	"brandCode"	text
);
DROP TABLE IF EXISTS "receipts";
CREATE TABLE IF NOT EXISTS "receipts" (
	"_id"	TEXT,
	"bonusPointsEarned"	BIGINT,
	"bonusPointsEarnedReason"	TEXT,
	"createDate"	BIGINT,
	"dateScanned"	BIGINT,
	"finishedDate"	BIGINT,
	"modifyDate"	BIGINT,
	"pointsAwardedDate"	BIGINT,
	"pointsEarned"	TEXT,
	"purchaseDate"	BIGINT,
	"purchasedItemCount"	BIGINT,
	"rewardsReceiptStatus"	TEXT,
	"totalSpent"	TEXT,
	"userId"	TEXT,
	PRIMARY KEY("_id")
);
DROP TABLE IF EXISTS "receipt_items";
CREATE TABLE IF NOT EXISTS "receipt_items" (
	"item_id"	INTEGER,
	"receipt_id"	TEXT,
	"barcode"	TEXT,
	"description"	TEXT,
	"finalPrice"	TEXT,
	"itemPrice"	TEXT,
	"needsFetchReview"	BOOLEAN,
	"needsFetchReviewReason"	TEXT,
	"partnerItemId"	TEXT,
	"preventTargetGapPoints"	BOOLEAN,
	"quantityPurchased"	INTEGER,
	"userFlaggedBarcode"	TEXT,
	"userFlaggedNewItem"	BOOLEAN,
	"userFlaggedPrice"	TEXT,
	"userFlaggedQuantity"	INTEGER,
	"discountedItemPrice"	TEXT,
	"originalReceiptItemText"	TEXT,
	"itemNumber"	TEXT,
	"originalMetaBriteBarcode"	TEXT,
	"originalMetaBriteDescription"	TEXT,
	"pointsNotAwardedReason"	TEXT,
	"pointsPayerId"	TEXT,
	"rewardsGroup"	TEXT,
	"rewardsProductPartnerId"	TEXT,
	"competitiveProduct"	BOOLEAN,
	"pointsEarned"	TEXT,
	"targetPrice"	TEXT,
	"originalMetaBriteQuantityPurchased"	INTEGER,
	PRIMARY KEY("item_id" AUTOINCREMENT),
	FOREIGN KEY("receipt_id") REFERENCES "receipts"("_id")
);
COMMIT;
